import react from 'react';
import Footer from '../../components/footer/footer';
import ProductCard from '../../components/cards/productCards';
import Styles from '../publicRoutes/home.module.css'
import products from '../../mockData/products.json';

const imageMapping = {
    'shoe_photo1' : '../../assets/photos/shoe_photo1.jpeg',
    'shoe_photo2': '../../assets/photos/shoe_photo2.jpeg',
    'shoe_photo3': '../../assets/photos/shoe_photo3.jpeg',
    'top_photo1': '../../assets/photos/suit_photo1.webp',
    'tops_photo2': '../../assets/photos/suit_photo2.jpeg',
    'tops_photo3': '../../assets/photos/suit_photo3.webp',
    'suit_photo1': '../../assets/photos/top_photo1.jpeg',
    'suit_photo2': '../../assets/photos/tops_photo2.jpeg',
    'suit_photo3': '../../assets/photos/top_photo3.webp',
}

function Home() {
    return (
        <div>

            {products[0].data.map((product) => {
                return (
                    <div className={Styles.productcontainer}>
                        <ProductCard
                        key={product.id}
                        name={product.name}
                        description={product.description}
                        category={product.category_id}
                        price={product.price}
                        imageName={imageMapping[product.image_url]}
                        className={Styles.productCard}
                        />
                    </div>
                )
            })
            }
            <div>
                <Footer />
            </div>
        </div>
    );
};

export default Home;
